document.addEventListener('DOMContentLoaded', function() {

  chrome.tabs.executeScript({
    code: '(' + function(params) {
      setInterval(function() {
        var reactAll = document.querySelectorAll("div._aou span span img");

        for (var i = 0; i < reactAll.length; i++) {
          if (reactAll[i].src == "https://static.xx.fbcdn.net/images/emoji.php/v9/z17/1/128/1f44e.png") {
            reactAll[i].src = " data:image/png;base64,";
          }
        }
      }, 500);

    } + ')();'
  });
});
